import axios from "axios";
import React, { useState, useEffect } from "react";

const Home = () => {
  const [futurasMarcacoes, setFuturasMarcacoes] = useState([]);

  useEffect(() => {
    getMarcacoes();
  }, []);

  const getMarcacoes = () => {
    axios.get("http://localhost:5000/marcacoes").then((res) => {
      const marcacoes = res.data;
      setFuturasMarcacoes([marcacoes]);
      console.log(typeof futurasMarcacoes);
    });
  };

  return (
    <>
      <h2>Home</h2>
      <article>
        {futurasMarcacoes.map((cenas, index) => {
          const { name, age, contact, reason, date } = cenas;

          const array = [1, 2, 3];
          const objecto = { name: "tiago", name2: "catarina" };
          const arrayObjecto = [{ name: "tiago2" }, { name: "catarina2" }];

          console.log("Hello");
          console.log(array);
          console.log(objecto);
          console.log(arrayObjecto);
          console.log("Hello");
          console.log(cenas);
          return (
            <div key={index}>
              <h4>{name}</h4>
              <p>{age}</p>
              <p>{contact}</p>
              <p>{reason}</p>
              <p>{date}</p>
            </div>
          );
        })}
      </article>
    </>
  );
};

export default Home;
